import React from 'react';

const Header = () => {
  return (
    <header>
      <h1>Звукова Студія</h1>
      <nav>
        <ul>
          <a Link to="/">Головна</a>
          <a Link to="#about">Про нас</a>
          <a Link to="#services">Наші Послуги</a>
          <a Link to="#portfolio">Портфоліо</a>
          <a Link to="#director">Від Директора</a>
          <a Link to="#more-serv">Більше Послуг</a>
          <a Link to="#clients">Відгуки</a>
          <a Link to="#contacts">Контакти</a>
          <a href="/bonuspage" target="_blank" rel="noopener noreferrer">Adobe Audition</a>
          <a href="/extrapage" target="_blank" rel="noopener noreferrer">FL Studio</a>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
